import { FaHeart } from 'react-icons/fa';

const Card = ({course}) => {
  return (
    <div>
      <img src={course?.image?.url} alt="" srcset="" />
      <button><FaBeer /></button>
      <div className="course-info">
        <h4 className="course-head">{course?.title}</h4>
        <p className="course-para">{course?.description}</p>
      </div>
    </div>
  )
}

export default Card
